import React from 'react'
import './footer.css'

export default function Footer() {
  return (
    <div className='footer-style row'>
        <footer className='py-2 text-center'>
        <small className='copyright'>&copy; Copyright 2022 | All rights reserved <br/>Created by  
            <a href="https://github.com/noah-mydn" 
            id="profile-link" target="_blank"> May Yadanar </a></small>
        </footer>
    </div>
  )
}
